import React, { Component } from "react";
import BabyInfo from "../babyInfo/BabyInfo";
import Nutrition from "../nutritionInfo/Nutrition";
import WeekData from "../weekData/WeekData";
import Advice from "../weeklyAdvice/Advice";
import Exercise from "../weeklyExercise/Exercise";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import { useState, createContext } from "react";
import ReactDOM from "react-dom/client";

export const WeeklyInfoContextt = React.createContext();

function WeeklyInfo() {
  const [weeklyInfo, setWeeklyInfo] = useState({
    weekNumber: "19",

    weeklyAdvice: {
      weekNumber: "19",
      message: "this is week 17 advice",
    },
    babyInfo: {
      weekNumber: "19",
      weight: "0.45",
      height: "0.65",
      generalInfo: "the second week is always the easiest one",
    },
    momInfo: {
      weekNumber: "19",
      nutritionInfo: {
        weekNumber: "18",
        briefInfo: "this is week 17 brief info",
        detailInfo: "this is week 17 detail info",
      },
      feelingsInfo: {
        weekNumber: "19",
        briefInfo: "this is week 17 brief info feelings",
        detailInfo: "this is week 17 detail info feelings",
      },
      exerciseInfo: {
        weekNumber: "19",
        briefInfo: "this is week 17 brief info exercise",
        detailInfo: "this is week 17 detail info exercise",
      },
    },
    weekData: {
      weekStartDate: "2022-05-06",
      weekEndDate: "2022-05-13",
    },
  });

  return (
    <WeeklyInfoContextt.Provider value={weeklyInfo}>
      <div>
        <Card style={{ width: "18rem" }}>
          <ListGroup variant="flush">
            <ListGroup.Item>
              <WeekData />
            </ListGroup.Item>
            <ListGroup.Item>
              <Advice />
            </ListGroup.Item>
            <ListGroup.Item>
              <BabyInfo />
            </ListGroup.Item>
            <ListGroup.Item>
              <Exercise />
            </ListGroup.Item>
            <ListGroup.Item>
              <Nutrition />
            </ListGroup.Item>
          </ListGroup>
        </Card>
      </div>
    </WeeklyInfoContextt.Provider>
  );
}
export default WeeklyInfo;
